import React, { useState } from 'react';
import { useDrag, useDrop } from 'react-dnd';

const LOGIC_BLOCKS = [
  { label: 'Smart Buys in 10m', type: 'smart-buys', color: 'green', icon: '🧠' },
  { label: 'Volume Spike > X%', type: 'volume-spike', color: 'blue', icon: '📈' },
  { label: 'Exclude Exit Liquidity', type: 'exclude-exit', color: 'red', icon: '🚫' },
  { label: 'GambleFi Tag', type: 'narrative', color: 'purple', icon: '🎲' },
];

function LogicBlock({ label, type, color, icon }) {
  const [, drag] = useDrag(() => ({
    type: 'block',
    item: { type, label, color, icon },
  }), [type, label, color, icon]);
  return (
    <div
      ref={drag}
      className={`flex items-center gap-2 bg-neutral-800 rounded-lg px-4 py-2 cursor-move hover:bg-zinc-800 transition-all duration-200 shadow group border-l-4 border-${color}-400`}
    >
      <span className="text-xl">{icon}</span>
      <span className="font-semibold text-base text-white group-hover:text-white/90 transition">{label}</span>
    </div>
  );
}

const previewTokens = [
  { name: 'PAWPAW', risk: 'Low', meta: 'GambleFi', roi: '+24%' },
  { name: 'BABY BOB', risk: 'Low', meta: 'GambleFi', roi: '+34%' },
];

export default function CreateTab({ goBack }) {
  const [logicBlocks, setLogicBlocks] = useState([]);
  const handleDrop = (block) => setLogicBlocks((prev) => [...prev, { ...block }]);
  const handleRemove = (idx) => setLogicBlocks((prev) => prev.filter((_, i) => i !== idx));
  const handleClear = () => setLogicBlocks([]);

  // Drag-and-drop drop area
  const [{ isOver }, drop] = useDrop(() => ({
    accept: 'block',
    drop: (item) => handleDrop(item),
    collect: (monitor) => ({
      isOver: monitor.isOver(),
    }),
  }), [handleDrop]);

  return (
    <div className="relative h-screen w-full bg-black text-white">
      {goBack && (
        <button
          onClick={goBack}
          className="absolute top-4 left-4 z-50 flex items-center text-sm text-blue-400 hover:underline focus:outline-none bg-black/50 px-3 py-2 rounded-lg backdrop-blur-sm"
        >
          <span className="mr-2">←</span> Back to Home
        </button>
      )}
      <div className="grid grid-cols-[20%_60%_20%] gap-4 px-6 py-4 h-full">
        {/* Left: Logic Blocks */}
        <div className="bg-zinc-900 rounded-xl p-4 flex flex-col gap-4 shadow-lg">
          <h2 className="text-lg font-semibold text-white">🧠 Logic Blocks</h2>
          {LOGIC_BLOCKS.map((block) => (
            <LogicBlock key={block.type} {...block} />
          ))}
        </div>

        {/* Center: Strategy Flow Canvas */}
        <div className="bg-zinc-950 p-4 rounded-xl h-full relative shadow-lg flex flex-col">
          <div className="flex justify-between mb-4">
            <div className="text-lg font-semibold">⚙️ Strategy Canvas</div>
            <button onClick={handleClear} className="text-xs bg-zinc-800 px-2 py-1 rounded hover:bg-zinc-700">Clear All</button>
          </div>
          <div
            ref={drop}
            className={`border border-zinc-700 rounded-md p-4 h-full flex flex-wrap gap-4 items-start text-white transition-all duration-200 ${isOver ? 'border-blue-400 shadow-lg' : ''}`}
          >
            {logicBlocks.length === 0 ? (
              <div className="flex items-center justify-center h-full text-neutral-600 text-center w-full">
                [Drag logic blocks here to build your strategy]
              </div>
            ) : (
              logicBlocks.map((b, i) => (
                <span key={i} className={`flex items-center gap-2 px-3 py-1 rounded font-semibold text-base shadow bg-${b.color}-900/60 text-${b.color}-200 transition-all duration-200 bg-opacity-80`}> 
                  <span className="mr-1">{b.icon}</span>
                  {b.label}
                  <button
                    className="ml-1 text-red-400 hover:text-red-600 text-xs font-bold px-1"
                    onClick={() => handleRemove(i)}
                    title="Remove block"
                  >×</button>
                </span>
              ))
            )}
          </div>
          <div className="absolute bottom-4 left-4 text-sm text-neutral-400">
            Summary: {"Tokens with smart wallet buys >2 in 10m AND volume spike >300% AND no exit liquidity"}
          </div>
        </div>

        {/* Right: Live Token Preview */}
        <div className="bg-zinc-900 p-4 rounded-xl shadow-lg flex flex-col">
          <div className="flex items-center justify-between mb-2">
            <div className="text-lg font-semibold">📡 Token Preview</div>
            <span className="text-xs bg-green-800 px-2 py-0.5 rounded text-green-300">LIVE</span>
          </div>
          <div className="space-y-3">
            {previewTokens.map((t) => (
              <div key={t.name} className="bg-neutral-800 rounded-md p-3 flex justify-between items-center hover:scale-[1.02] hover:bg-neutral-700 cursor-pointer transition-all duration-200">
                <div>
                  <div className="font-semibold">{t.name}</div>
                  <div className="text-xs text-neutral-400">Risk: {t.risk} • Meta: {t.meta}</div>
                </div>
                <div className="text-green-400 font-bold">{t.roi}</div>
              </div>
            ))}
          </div>
          <div className="mt-6">
            <button className="w-full text-sm text-white bg-purple-700 hover:bg-purple-600 py-2 rounded transition">Publish Flow 💸</button>
            <button className="w-full text-sm text-white mt-2 border border-zinc-600 py-2 rounded hover:bg-zinc-800 transition">Save Draft 💾</button>
          </div>
        </div>
      </div>
    </div>
  );
}
